$(document).ready(function(){var n=$("#subscriptionTable").DataTable({processing:!0,serverSide:!0,searchDelay:500,filter:!0,orderMulti:!1,pageLength:25,lengthMenu:[[10,25,50,100],[10,25,50,100]],language:{url:"/lib/DataTables/dataTablesGerman.json"},ajax:{url:"/Subscription/LoadDefaultData",type:"POST",datatype:"json",data:function(n){n.planId=$("#PlanMethodSelect option:selected").val();n.statusId=$("#StatusMethodSelect option:selected").val()}},columnDefs:[{targets:[0],visible:!1,searchable:!1},{width:"100px",targets:1},{width:"300px",targets:2},{width:"300px",targets:3},{width:"110px",targets:4},{width:"110px",targets:5},{width:"110px",targets:6},],columns:[{data:"id",name:"Id",autoWidth:!0},{data:"plantNr",name:"RebstockNr",autoWidth:!1},{data:"customer",name:"Kunde",autoWidth:!1},{data:"plan",name:"Patenschaft",autoWidth:!1},{data:"periode",name:"Laufzeit",autoWidth:!1},{data:"payed",name:"Bezahlt",autoWidth:!1},{data:"status",name:"Status",autoWidth:!0},]});$("#subscriptionTable").on("draw.dt",function(){$(".paginate_button").removeClass("paginate_button").addClass("mui-btn mui-btn--flat");$(".mui-btn mui-btn--flat.current").addClass("mui-btn--primary")});$("select").on("change",function(){n.ajax.reload()});$.contextMenu({selector:"#subscriptionTable tbody td",callback:function(t,i){var f=parseInt(i.$trigger[0].cellIndex),r=n.row(i.$trigger[0].parentNode),u=r.index();switch(t){case"edit":window.location.href="/Subscription/Edit/"+n.cell(u,0).data()}},items:{edit:{name:"Bearbeiten",icon:"edit"}}});$(function(){$("select").removeAttr("multiple")})});